script: |
  super -f text -I q5356.spq | sort > q5356.out

inputs:
  - name: q5356.spq
    data: |
      SELECT - col0 AS col1 FROM tab2 (FORMAT parquet) WHERE - col2 BETWEEN + + col1 * + col2 * + + ( + + col2 ) + + col0 * + col2 AND + - col0;
  - name: tab2

outputs:
  - name: q5356.out
    data: |
